console.log("This works");const now=new Date,WEDDING_DATE=new Date("February 1, 2020 10:00:00");function updateTimer(){let e=WEDDING_DATE-now;const o=document.querySelector("#day"),t=document.querySelector("#hour"),n=document.querySelector("#second"),r={days:Math.floor(e/864e5),hours:Math.floor(e/36e5%24),seconds:Math.floor(e/1e3%60)};o.textContent=r.days,t.textContent=r.hours,n.textContent=r.seconds}updateTimer();